import styled from "styled-components";
import Fundo from '../../assets/fundo.jpeg';

export const Container = styled.section`
    position: relative;
    display: flex;
    align-items: center;
    height: 100vh;
    width: 100%;
    box-sizing: border-box;
    background: url('${Fundo}') no-repeat;
    background-size: cover;


    /* img {
        width: 100%;
        height: 100%;
    } */
`;
